import {useState} from "react"

import Produit from "./Produit"


export default function Donnes (){
    const [produits, setProduits] = useState([
        {
            id:1,
            nom:"DAVY",
            img:"/imgtest3.jpeg"
        },

        {
            id:2,
            nom:"Emma",
            img:"/imgtest1.jpeg"
        },

        {
            id:3,
            nom:"nora",
            img:"/teste002.jpeg"
        },

        {
            id:4,
            nom:"mika",
            img:"/imgtes0.jpeg"
        },

        {
            id:5,
            nom:"chris",
            img:"/imgtes1.jpeg"
        },

        {
            id:6,
            nom:"Noe",
            img:"/teste002.jpeg"
        },
    ])

    return (
        <ul>
            {produits.map(item=>{
                return (
                    <li keys={item.id}>
                        <img src={item.img} alt={item.nom} />
                        <h3>{item.nom}</h3>
                    </li>
                )
            })}
        </ul>
    )
}
